// Sample images bave been converted to base64 string for easy processing
let SAMPLE_IMAGE_1 = {
	base64: "data:image/jpeg;base64,"
};

let SAMPLE_IMAGE_2 = {
	base64: " data:image/jpeg;base64,"
};


let sampleImages = [
	SAMPLE_IMAGE_1,
	SAMPLE_IMAGE_2,
];

renderSampleImages = () => {
	sampleImages.forEach((e) => {
		let image = document.createElement('IMG');
		Object.assign(image, {
			src: e.base64,
			id: `SAMPLE_IMAGE_${sampleImages.indexOf(e) + 1}`,
		});
		$(image).attr('onclick', 'selectImage(sampleImages)');
		$('#sample-images').append(image);
	});
};

// Render sample images from base 64 sring to #sample-images
renderSampleImages();
